/**
 * @param {number[]} numbers
 * @param {number} target
 * @return {number[]}
 */
const twoSum = function(numbers, target) {
    let answerArray = [];
    // let prevIndices = [];

    for (let i = 0; i < 3; i ++) {
        // console.log(i);
        let numberDiff = target - numbers[i];
        console.log(numberDiff);
        let otherNumberIndex = binarySearch(numbers, numberDiff, i);
        console.log('other number index', otherNumberIndex);
        console.log('answer array', answerArray);
        if (otherNumberIndex === i) {
            console.log(`index ${otherNumberIndex} is the same as i ${i}`);
            continue;
        }

        if (otherNumberIndex && !answerArray.includes(i + 1) && !answerArray.includes(otherNumberIndex + 1)) {
            console.log('found a match', i, otherNumberIndex);
            answerArray.push(i + 1, otherNumberIndex + 1);
            // prevIndices.push(i);
        }
    }

    return answerArray;

    // console.log('answer array', answerArray);
};

function binarySearch(array, target, currentIndex) {
    let left = 0;
    let right = array.length - 1;
    let mid;

    while (left <= right) {
        mid = Math.floor((left + right) / 2);

        if (array[mid] === target) {
            if (mid === currentIndex) {
                left = mid + 1;
            } else {
                return mid;
            }
        } else if (array[mid] < target) {
            left = mid + 1;
        } else {
            right = mid - 1;
        }
    }

    return null;
}

